import React from "react";
import { Link } from "react-router-dom";

const navLinks = [
  {
    title: "Home",
    path: "/",
  },
  {
    title: "Blog",
    path: "/blog",
  },
  {
    title: "Contact Us",
    path: "/contact-us",
  },
  {
    title: "Login",
    path: "/login",
  },
];

const Navigation = () => {
  return (
    <nav className="site-navigation">
      <span>Stalic"s blog</span>
      <ul>
        {navLinks.map((link, index) => {
          return (
            <li key={index}>
              <Link>{link.title}</Link>
            </li>
          );
        })}
      </ul>
    </nav>
  );
};

export default Navigation;
